export const ShopContaxt = createContext();
export const ShopContaxtProvider = ({ children }) =>{
  const currency ='$'
  const dilivery_fee ='20'
  const value ={
    currency,dilivery_fee
  }
  return (
    <ShopContaxtProvider value={{value}}>
        {children}
    </ShopContaxtProvider>
  )
}
